import './scss/app.scss';
import Header from './components/Header/Header';
import Categories from './components/Categories/Categories';
import Sort from './components/Sort/Sort';
import PizzaItem from './components/PizzaBlock/PizzaBlock';


function App() {
	return (
		<div class="wrapper">
			<Header />
			<div class="content">
				<div class="container">
					<div class="content__top">
						<Categories />
						<Sort />
					</div>
					<h2 class="content__title">Все пиццы</h2>
					<div class="content__items">
						<PizzaItem price={300} title='Чизбургер' />
						<PizzaItem price={300} title='Мексикансая' />
						<PizzaItem price={300} title='Домашняя' />
						<PizzaItem price={300} title='Диабло' />
						<PizzaItem price={300} title='Пепперони' />
						<PizzaItem price={300} title='Маргарита' />
						<PizzaItem price={300} title='4 сыра' />
						<PizzaItem price={300} title='Мясная' />
						<PizzaItem price={300} title='Овощная' />
					</div>
				</div>
			</div>
		</div>
	);
}

export default App;
